import React from "react";

const App = () => {
  let fname = "Dinga";
  let lname = "Raja";
  let num = 20;


  return (
    <React.Fragment>
      {/* Static Content */}
      <h1> Welcome to React class</h1>

      {/* Static with Dynamic Content */}
      <h3>
        My name is {fname} {lname}
      </h3>

      {/* Dynamic Content */}
      <h3>{num}</h3>
    </React.Fragment>
  );
};

export default App;
